def composite_nums_between_indices(nums):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    composite_nums = set()
    for i in range(50, 55):
        if not is_prime(nums[i]):
            composite_nums.add(nums[i])

    return composite_nums
```
Note: The function `is_prime` is used to check if a number is prime. It returns `True` if the number is prime, and `False` otherwise.
